  const [weatherData, setWeatherData] = useState([])
  const [nameCity, setNameCity] = useState('')

  return (
    <div className="App">
      <BrowserRouter>
        <Header />
      </BrowserRouter>
        <InputSearch weatherData={setWeatherData} nameCity={setNameCity} />
    </div>
  );
}

export default App;
